import React from 'react';

class Type extends React.Component{
    render(){
        let type = this.props.type
        switch (status) {
            case 'enable':
                status = 'ON';
                break;
            case 'disable':
                status = 'OFF';
                break;
            case 'blocked':
                status = 'BLOCK';
                break;
        }
        return (
            
            <div>{this.props.type}</div>
        )
    }
}


export default Type;
